import React, { Fragment } from "react";
import styled from "styled-components";

const Container = styled.div`
  height: 30%;
  padding: 0 2rem;
  width: 100%;
  box-shadow: #e9e9e9 0px 1px 4px;
  margin: 30px 0;
//   display:flex;
`;

const SearchFormFields = [
  {
    type: "text",
    name: "transactionId",
    placeholder: "Search Trans Id",
    label: "",
  },
  {
    type: "text",
    name: "min",
    placeholder: "Min",
    label: "Amount",
  },
  {
    type: "text",
    name: "binNumber",
    placeholder: "Bin Num",
    label: "BIN Number",
  },
  {
    type: "email",
    name: "email",
    placeholder: "Email",
    label: "Email",
  },
];

export const FormGroup = styled.div`

`;
export const FormDesc = styled.h3`
  color: #888;
`;

export const Input = styled.input`
  padding: 0.4rem 3rem 0.4rem 0.8rem;
  font-size: 1rem;
  font-weight: 300;
  border: 1px solid #ccc;
  border-radius: 25px;
  width: 100px;
`;

const SecondSearchRow = styled.div`
  display: flex;
`;
const Search = () => {
  return (
    <Container>
      <SecondSearchRow>
        <form>
          {SearchFormFields.map((formField, index) => {
            const { type, name, placeholder, label } = formField;
            return (
              <Fragment key={index}>
                <FormDesc>{label}</FormDesc>
                <FormGroup>
                  <Input
                    type={type}
                    name={name}
                    //   onChange={(e) => onChange(e)}
                    placeholder={placeholder}
                    //   value={formData[name]}
                  />
                </FormGroup>
              </Fragment>
            );
          })}
          {/* <Button onClick={(e) => onSubmit(e)}>
          Submit
        </Button> */}
        </form>
      </SecondSearchRow>
    </Container>
  );
};

export default Search;
